import config from '@/config';
import Generator from '@/webApi/generator'
export default new Generator({
    //发货单位层级数据
    GetSendUnitLevelList: {url: '/DictDataService/GetSendUnitLevelList', method: 'get'},
     //收货单位层级数据
     GetReceivUnitLevelList: {url: '/DictDataService/GetReceivUnitLevelList', method: 'get'},
     //出库发货单位
     GetSendOutWareHoustList:{url:'/DictDataService/GetSendOutWareHoustList',method:'post'},
    //出库收货单位
     GetReceivOutWareHoustList:{url:'/DictDataService/GetReceivOutWareHoustList',method:'post'},
    //入库发货单位
     GetSendInWareHouseList:{url:'/DictDataService/GetSendInWareHouseList',method:'post'},
    //入库收货单位
     GetReceivInWareHouseList:{url:'/DictDataService/GetReceivInWareHouseList',method:'post'},
    //调拨发货单位
     GetSendAllocationList:{url:'/DictDataService/GetSendAllocationList',method:'post'},
     //调拨收货单位
     GetReceivAllocationList:{url:'/DictDataService/GetReceivAllocationList',method:'post'},
}, config.pgyerApiUrl);
